import { Fragment } from "react";

import AvailableMeals from "./AvailableMeals";
import MealsSummary from "./MealsSummary";
import Item from "../item/Item";

const props = [
  {
    src: "../../../img/book.jpg",
    title: "1",
    content: "일",
    price: 10000
  }
]

const Meals = () => {
  return (
    <Fragment>
      {/* <MealsSummary />
      <AvailableMeals /> */}
      <Item props={props} />
    </Fragment>
  );
};

export default Meals;
